    /**Gets the attribute value for the calculated attribute RentaExentas
     */
    public Number getRentaExentas() {
        Number vRentasExentas;
        vRentasExentas=new Number();
        
        if (this.getAnio().compareTo(2013)==0){
         
          vRentasExentas=  utils.getNumberOracle(Math.min(this.getIngresoMensual().getValue(),this.getBono14Proyectado().getValue()));
          vRentasExentas=vRentasExentas.add(utils.getNumberOracle(Math.min(this.getIngresoMensual().getValue(),this.getAguinaldoProyectado().getValue())));
        
        } 
         else{
         
           vRentasExentas=this.getAguinaldoProyectado().add(this.getBono14Proyectado());
            
        }
        
        return  vRentasExentas;
    }

