    /**Gets the attribute value for the calculated attribute Devolucion
     */
    public Number getDevolucion() {
    
        Number vDevolucion;
        Number vDiferencia;
        Number vDiferencia2;
        
       vDiferencia=this.getIsrAnual().subtract(this.getPlanillaIva());
        
        if (vDiferencia.compareTo(0)<0)
        {
            
            if (this.getOpcionRetension()!=null && this.getOpcionRetension().compareTo(1)==0){
                
                vDevolucion=this.getRetencionEfectuada().add(this.getRetencionOtropatrono());
                
            }else{
            
                vDevolucion=this.getRetencionEfectuada();      
            }
            
            
        }
        else
        {
        
            vDiferencia2=this.getRetencionEfectuada().subtract(vDiferencia);
          
            if (vDiferencia2.compareTo(0)<0){
                //vDevolucion=new Number(0); //this.getImpuestoAPagar()
                
                if (this.getImpuestoAPagar2().compareTo(0)<0){
                
                    vDevolucion= new Number(this.getImpuestoAPagar2().abs());    
                    
                }else {
                    
                    vDevolucion=new Number(0);
                    
                }
                
                
                
            }else {
                vDevolucion=vDiferencia2;
            }
            
        }
        
    return vDevolucion;
    }

